Experimental Subject's Bill of Rights:
You have been asked to participate as a subject in a research study. Before you decide whether you want to participate in the study, you have a right to:

 a. Be informed of the nature and purpose of the experiment;

 b. Be given an explanation of the procedures to be followed in the research experiment, and any drug or device to be utilized;

 c. Be given a description of any attendant discomforts and risks reasonably to be expected from your participation in the experiment;

 d. Be given an explanation of any benefits reasonably to be expected from your participation in the experiment;

 e. Be given a disclosure of any appropriate alternative procedures, drugs or devices that might be advantageous to you an their relative risks and benefits;

 f. Be informed of the avenues of medical treatment, if any, available to you after the experimental procedure if complications should arise;

 g. Be given an opportunity to ask any questions concerning the research experiment or the procedures involved;

 h. Be instructed that consent to participate in the experimental procedure may be withdrawn at any time and that you may discontinue participation in the research experiment without prejudice;

 i. Be given a copy of this form and the signed and dated consent form; and

 j. Be given the opportunity to decide to consent or not to consent to the research experiment without the intervention of any element of force, fraud, deceit, duress, coercion or undue influence on your decision. I understand my rights as described above:
